var express = require("express");
var app = express();

app.set("view engine", "ejs");

app.get("/", (req, res) => {
    res.render("landing");
});

app.get("/campgrounds", (req, res) => {
    var campgrounds = [
        { name: "Linus Sabestian", image: "data:image/jpeg;base64," },
        { name: "Yosemite", image: "data:image/jpeg;base64," },
        { name: "Mojave", image: "data:image/jpeg;base64," }
    ]

    res.render("campgrounds", {campgrounds: campgrounds});
});




app.listen(3000, () => {
    console.log("server started!");
});